import React, { useState } from 'react';
import Button from 'react-bootstrap/Button';
import Modal from 'react-bootstrap/Modal';

export default function ImgFullScreen(props) {
    const [show, setShow] = useState(false);

    return (
        <>
            <Button type="button" class="me-2 mb-2 btn btn-primary" onClick={() => setShow(true)}>{props.children}</Button>
            <Modal show={show} fullscreen={true} onHide={() => setShow(false)}>
                <Modal.Header closeButton>
                    <Modal.Title>Modal</Modal.Title>
                </Modal.Header>
                <Modal.Body><img className='img-fluid' alt='random image' src={props.src} ></img></Modal.Body>
            </Modal>
        </>
    );
}
